import { Component } from "react";
import { Link } from "react-router-dom";


class REAMyListings extends Component{
    render(){
        return(
            <>
            <div>
                <h2>My Listings</h2>
                <Link to="/"><button>Create Listing</button></Link>
            </div>
            </>
        )
    }
}

export default REAMyListings;
